  \"2016-11-25T21:06:27.068589\",\n\t\"name\": \"2011-national-assessment-of-educational-progress\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2011 (NAEP 2011), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data available since 1971 at <http://nces.ed.gov/nationsreportcard/naepdata/>.
  NAEP 2011 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in various subject areas. The study
  was conducted using computer-based assessments of students. Students in grades 4,
  8, and 12 were sampled. NAEP 2011 assessments consist of national and state assessments
  in mathematics, reading, and writing. The studyufffds response rates were between
  87 and 98 percent. Key statistics produced from NAEP 2011 are results on subject-matter
  achievement, instructional experiences, and school environment for populations of
  students (e.g., all fourth-graders) and groups within those populations (e.g. female
  students, Hispanic students).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
